import toast from 'react-hot-toast';
import logo from '../assets/Logo.svg'
import { Link, NavLink } from 'react-router-dom'

const Navbar = (props) => {
    let isLoggedIn=props.isLoggedIn;
    let setIsLoggedIn=props.setIsLoggedIn;
    console.log(!isLoggedIn&&<NavLink to="/login"><button >Login</button></NavLink>)
  return (
    <div className='flex justify-evenly'>
        <div>
            <Link to="/"><img src={logo} alt="Logo" height={32} width={160} loading="lazy" /></Link>
        </div>
        <nav>
            <ul className='flex gap-3'>
                <li> <NavLink to="/">Home</NavLink> </li>
                <li> <NavLink to="/">About</NavLink> </li>
                <li> <NavLink to="/">Contact</NavLink> </li>

            </ul>
        </nav>
        <div className='flex gap-3'>
            {!isLoggedIn&&<NavLink to="/login"><button >Login</button></NavLink>}
            {!isLoggedIn&&<NavLink to="/signup"><button>Signup</button></NavLink>}
            {isLoggedIn&&<NavLink to="/"><button onClick={()=>{setIsLoggedIn(false)
                toast.success("LogOut Successfully !")
            }}>Logout</button></NavLink>}
            {isLoggedIn&&<NavLink to="/dashboard"><button>Dashoard</button></NavLink>}

        </div>
    </div>
  )
}

export default Navbar
